window.disableScroll=function(){const o=window.innerWidth-document.body.offsetWidth;document.body.dbScrollY=window.scrollY,document.body.style.cssText=`\n        position: fixed;\n        top: ${-window.scrollY}px;\n        left: 0;\n        width: 100%;\n        overflow: hidden;\n        height: 100vh;\n        padding-right: ${o}px;\n    `},window.enableScroll=function(){document.body.style.cssText="position: relative;",window.scroll({top:document.body.dbScrollY})};